import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import TodolistPage from './TodolistPage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/" component={TodolistPage} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
